<!DOCTYPE html>
<html>
    <head>
        <meta charset="utf-8">

        <style>
            .hero.is-primary {

            .hero.is-primary a {

            .hero.is-primary .subtitle,

            .hero-foot {
                padding: 2em;
            }

                width: 100%;
                height: 250px;
                background-color: white;
                margin: 1em;

    </head>

                </div>
            </div>
            <div class="hero-foot">
                <div class="container has-text-centered">
                    <div class="is-centered">

                    </div>
                </div>
            </div>
        </section>
